.title[
# R and Summary of Categorical Data
]
.date[
### September 4, 2025
]

---


## The Statistical Software

--

- The statistical software R is for *Data Days* and *Independent Project* **only**. 

--

- R  is installed in all computers in the classroom. 

--

- In your desktop, double click on the **R** icon to start R.


&lt;img src=&quot;data:image/png;base64,#../charts/rlogo.png&quot; width=&quot;10%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;

--

If you plan to use R at home, 
&lt;a href=&quot;https://cran.r-project.org/&quot; target=&quot;_blank&quot; style=&quot;font-size:18px;&quot;&gt; click here&lt;/a&gt;
to download the correct version for your system.


--

**Starting the R - Graphical User Interface**

--


- In the R  console, type **library(Rcmdr)**. Then, hit ENTER.

--

A new window will open. This is the starting point for your data analysis. 

---

&lt;img src=&quot;data:image/png;base64,#../../113/charts/Rcmd-fig1.png&quot; width=&quot;100%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;

---

In the **R SCRIPT** window, type one of the following expressions. Then, select it and click on SUBMIT.


- 2 + 3


- 2 + 3 * 5


- (2 + 3) * 5


- log(5)


- 6^2


- exp(3)


- sin(pi/2)


You can clear the window, by right click and selecting the option.


---

&lt;h1&gt; Exploring Data in R &lt;/h1&gt;

Data tables in R are known as  **DATA FRAMES**. One of many data frames available in the R system is **mtcars**.

--

**OPEN DATA**

In the top menu, click on: 

--

&gt; Step 1: DATA &gt; DATA IN PACKAGES &gt; Read data set from an attached package ...

--

&gt; Step 2: In the box &quot;Enter name of data set&quot;, type **mtcars**. Then click OK.

--

&gt; Step 3: Click on **View data set** to display the &quot;mtcars&quot; data table.

---

Answer the following questions about the data frame **mtcars**:

1) How many variable can you identify?

2) How many cars (or observations) were reported?

3) List any numeric (or quantitative) variables?

4) What variables can be considered categorical (or qualitative)? Explain if any?



---


### Variables in Data Frames

--

In this activity, you are going to work with the data frame **sleep**.

--

In the R Script, type and run **help(sleep)** to display the documentation related to this data frame.

--

*a)* How many variables can you identify in **sleep**?

--

- Three variables

--

*b)* What variables are quantitative (or numeric)?

--

- One variable: *extra*

--

*c)* What variables are categorical (or qualitative)?

--

- Two variables: *group* and *ID*


---


*d)* Identify the type of variables in the data set **chickwts**.

--

- Quantitative: *weight*

--

- Categorical: *feed*

--

**IMPORTANT:**

--

Everything in R is CASE SENSITIVE.

--

Variables in data frames are accessed with the DOLLAR sign. For example, run: 

- **sleep$extra**

--

The function **class()** returns the type of object in R. For example, run the following:


- **class(sleep)**


- **class(sleep$ID)**


- **class(sleep$extra)**


---


## Basic Concepts

A **variable** is any characteristic whose value may change from one individual or object to another. A variable can be any of two types:

--

- **Categorical (Qualitative)**: They represent categories or groups. For example, gender, color, or country.

--

- **Numeric (Quantitative)**: They measure how much or how many of something there is. Typically, they have units. For example, height, weight, or temperature.

--

Quantitative variables can be **discrete** or **continuous**. Numeric discrete are countable or exist for specific values. For example, phone calls, absent students, or broken computers. On the other hand, continuous are uncountable and they are best represented with intervals. For example, price, earning or speed.


---

**Categorical Data: Numeric Summary** 

--

Categorical data are summarized with a **frequency table**.

--

For example, consider the frequency table of the variable **feed** in the data frame **chickwts**.

--

- Step 1: Open R

--

- Step 2: In R Console, type **library(Rcmdr)** and hit ENTER. This action will bring the graphical user interface (GUI) for data analysis.


- Step 3: Click on DATA &gt; DATA IN PACKAGES &gt; Read data set from an attached package ...

--

- Step 4: Enter name of data set: **chickwts**

--

- Step 5: Click on STATISTICS &gt; SUMMARIES &gt; FREQUENCIES DISTRIBUTIONS

--

- Step 6: Select the variable **feed**, and click OK.

---

Frequency Table *(Counts)*



```

   casein horsebean   linseed  meatmeal   soybean sunflower 
       12        10        12        11        14        12 
```

Percentages:


```

   casein horsebean   linseed  meatmeal   soybean sunflower 
    16.90     14.08     16.90     15.49     19.72     16.90 
```

---

In the frequency table (counts), you can identify all categories in your data and count how many of them are available. With this information, you can tell which group is the least common, the most common, find the total and make comparison among them.

--

If you divide the frequency table by the total, you get the **relative frequency** (proportion) table. The relative frequency is the comparison of the frequency &quot;relative&quot; to the total. The best way to interpret (or explain) proportions in layman terms is with **percentages**. The percent is the proportion times 100. For example, we can say that 14.1% of chicken are feed with horsebean.

--

The percent in the relative frequency table refers to this specific data (or sample). However, if your data is a good representation of a large population, then you can make inference to that particular population by estimating that about 14% of chicken are fed with horsebean.


---

**Categorical Data: Graphical Summary**

--

A **Bar Graph** (or bar chart, bar plot) is the graphical representation of frequency (count) tables. Therefore, use this chart for categorical data.

--

**Bar Graph Characteristics**

- Each bar represents a category with height equal to its frequency *(or relative frequency)*.


- All bars must have the same width and color. 


- The bar plot must include a title, and axes with appropriate labels. 

--

**Bar Graphs in R**

- Step 1: Click on GRAPHS &gt; BAR GRAPH

- Step 2: Select the variable **feed**, and click OK.

---

&lt;img src=&quot;data:image/png;base64,#lecture-2_files/figure-html/unnamed-chunk-5-1.png&quot; style=&quot;display: block; margin: auto;&quot; /&gt;


---

You can specify title, axes labels and color to the bar chart. In step 2, before clicking OK, do the following:

- Step 3: Click on the **OPTIONS** tab.

- Step 4: Specify PLOT LABELS

- Step 5 (Optional): If you want red bars, add to the corresponding script **col=&quot;red&quot;, ** before xlab. Select the line and hit SUBMIT.


---

&lt;img src=&quot;data:image/png;base64,#lecture-2_files/figure-html/unnamed-chunk-6-1.png&quot; style=&quot;display: block; margin: auto;&quot; /&gt;

<script>var slideshow = remark.create({
  "countIncrementalSlides": false
});
if (window.HTMLWidgets) slideshow.on('afterShowSlide', function (slide) {
  window.dispatchEvent(new Event('resize'));
});
(function(d) {
  var s = d.createElement("style"), r = d.querySelector(".remark-slide-scaler");
  if (!r) return;
  s.type = "text/css"; s.innerHTML = "@page {size: " + r.style.width + " " + r.style.height +"; }";
  d.head.appendChild(s);

(function(d) {
  var el = d.getElementsByClassName("remark-slides-area");
  if (!el) return;
  var slide, slides = slideshow.getSlides(), els = el[0].children;
  for (var i = 1; i < slides.length; i++) {
    slide = slides[i];
    if (slide.properties.continued === "true" || slide.properties.count === "false") {
      els[i - 1].className += ' has-continuation';
    }
  }
  var s = d.createElement("style");
  s.type = "text/css"; s.innerHTML = "@media print { .has-continuation { display: none; } }";
  d.head.appendChild(s);
})(document);
// delete the temporary CSS (for displaying all slides initially) when the user
// starts to view slides
(function() {
  var deleted = false;
  slideshow.on('beforeShowSlide', function(slide) {
    if (deleted) return;
    var sheets = document.styleSheets, node;
    for (var i = 0; i < sheets.length; i++) {

      node.parentNode.removeChild(node);
    }
    deleted = true;
  });

// add `data-at-shortcutkeys` attribute to <body> to resolve conflicts with JAWS
// screen reader (see PR #262)
(function(d) {
  let res = {};
  d.querySelectorAll('.remark-help-content table tr').forEach(tr => {
    const t = tr.querySelector('td:nth-child(2)').innerText;
    tr.querySelectorAll('td:first-child .key').forEach(key => {
      const k = key.innerText;
      if (/^[a-z]$/.test(k)) res[k] = t;  // must be a single letter (key)
    });
  });
  d.body.setAttribute('data-at-shortcutkeys', JSON.stringify(res));
})(document);
(function() {
  "use strict"
  // Replace <script> tags in slides area to make them executable
  var scripts = document.querySelectorAll(
    '.remark-slides-area .remark-slide-container script'

  if (!scripts.length) return;
  for (var i = 0; i < scripts.length; i++) {
    var s = document.createElement('script');
    var code = document.createTextNode(scripts[i].textContent);
    s.appendChild(code);
    var scriptAttrs = scripts[i].attributes;
    for (var j = 0; j < scriptAttrs.length; j++) {
      s.setAttribute(scriptAttrs[j].name, scriptAttrs[j].value);
    }
    scripts[i].parentElement.replaceChild(s, scripts[i]);
  }

(function() {

<script>(function(data, token) {
  // data is an object of the form { path: base64 data }; we need to move base64
  // data back to HTML nodes (e.g., into the 'src' attribute of <img>, <audio>, <video>, <source>)
  var i, s, d, el, els;
  els = document.querySelectorAll(['img', 'audio', 'video', 'source'].map(x => x + '[src^="' + token + '"]').join(','));
  for (i = 0; i < els.length; i++) {
    el = els[i]; s = el.src.replace(token, ''); d = data[s];
    if (d) el.src = d;
  }
  els = document.querySelectorAll('div.remark-slide-content[style]');
  for (i = 0; i < els.length; i++) {
    el = els[i]; s = el.style.backgroundImage; if (!s) continue;
    s = s.match(/^url\("?(.+?)"?\)$/); if (!s || s.length < 2) continue;
    s = s[1].replace(token, ''); d = data[s];
    if (d) el.style.backgroundImage = 'url("' + d + '")';
